import React from "react";


function Header(){
    const titel={
        designr :"designr",
        programor :"programing"
    };
    const clain = "programing";
    const claininfo={
        name:"hicham",
        pnome:"benkaida"
    };
    return(
        <div className="navbar bg-dark rounded">
            <h2 className="text-white">
                Hello
                {clain === "designr" ? titel.designr:titel.programor}
                is my life
                </h2>
        </div>
    );
}
export default Header;
